To właśnie SKIraport.pl - stworzony przez narciarzy dla narciarzy (dla snowboardzistów też ;) )!

SKIraport to najbardziej zaawansowana na krajowym rynku mobilna aplikacja na smartfony i tablety z systemem iOS, dedykowana specjalnie dla wszystkich miłośników białego szaleństwa na polskich stokach. Nieważne, czy jeździsz na dwu, czy na jednej desce, jeśli kochasz góry tak mocno, jak my, to SKIraport jest właśnie dla Ciebie.
Najpopularniejsze w Polsce górskie miejscowości, najbardziej malownicze stoki, najciekawsze oceny i komentarze, najświeższe prognozy pogody, najnowsze wieści ze stacji narciarskich w jednym miejscu, stale w zasięgu ręki.
Pobierz już dziś (oczywiście za darmo!), dołącz do grona ponad 90 tys. użytkowników i uzyskaj natychmiastowy dostęp do:

- Prognozy pogody wprost ze sprawdzonego serwisu YR.NO;
- Stale aktualizowanych informacji o warunkach na trasach narciarskich;
- Listy czynnych wyciągów narciarskich i kolei linowych;
- Szczegółowych map stoków i tras;
- Pełnych informacji o dostępnych usługach, noclegach i innych atrakcjach na stokach;
- Podglądu sytuacji na stokach dzięki kamerom online;
- Ocen i komentarzy innych narciarzy - użytkowników SKIraport;
- Pełna integracja z e-Skipass.pl - kupuj karnety e-Skipass za pośrednictwem Mastercard Mobile i korzystaj z ponad 50 ośrodków narciarskich
